import React from 'react';
import MyContext from './my_context.js';





class PriceTrending extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            change: '0.0',
        };
    }

	render() {
		return (
			<div>
				<MyContext.Consumer>
					{
						market_data => {
							var ss = market_data.data.s
							var oo = market_data.data.o
							return (
								<div>
									<h3>{ss} - {oo}</h3>
									<h3>{ this.props.data_list }</h3>
								</div>
							)
						}
					}
				</MyContext.Consumer>
			</div>
		);
	}
}

export default PriceTrending;
